import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // --- Begin automation logic for applying Price Range Filter ---

    // 1. Wait for the "Shop now" button and click it to ensure main content loads (if needed)
    //    Use text selector to avoid class-based selectors
    const shopNowBtn = await page.waitForSelector('button:has-text("Shop now")', { timeout: 5000 });
    await shopNowBtn.click();

    // 2. Wait for the "Electronics" category card (as a visual anchor)
    await page.waitForSelector('.category-card:has-text("Electronics")', { timeout: 5000 });

    // 3. Click the "Electronics" category card to load products (using text content)
    const electronicsCard = await page.$('//div[contains(@class,"category-card")][.//h3[contains(text(),"Electronics")]]');
    if (electronicsCard) {
      await electronicsCard.click();
    }

    // 4. Wait for the Price Range filter to appear (using heading text)
    await page.waitForSelector('text=Price Range', { timeout: 5000 });

    // 5. Fill in the Min and Max price inputs (using input[placeholder] selectors)
    const minInput = await page.waitForSelector('input[placeholder="Min"]', { timeout: 5000 });
    await minInput.fill('100');
    const maxInput = await page.waitForSelector('input[placeholder="Max"]', { timeout: 5000 });
    await maxInput.fill('500');

    // 6. Take screenshot before applying filter
    const beforeApplyShot = path.join(screenshotsDir, 'step_2_before_apply_filter.png');
    await page.screenshot({ path: beforeApplyShot });
    screenshots.push(beforeApplyShot);

    // 7. Click the "Apply" button (using button text)
    const applyBtn = await page.waitForSelector('button:has-text("Apply")', { timeout: 5000 });
    await applyBtn.click();

    // 8. Wait for products grid/list to update (wait for a product price within the range)
    //    Use a price text selector to verify filter worked
    await page.waitForSelector('.product-price:text-matches("^\\$1[0-9]{2}\\.\\d{2}|^\\$[2-4][0-9]{2}\\.\\d{2}", "i")', { timeout: 5000 });

    // 9. Take screenshot after applying filter
    const afterApplyShot = path.join(screenshotsDir, 'step_3_after_apply_filter.png');
    await page.screenshot({ path: afterApplyShot });
    screenshots.push(afterApplyShot);

    // 10. Extract product titles and prices currently visible (verify filter)
    const productCards = await page.$$('.product-card, .product-card-list');
    let filteredProducts = [];
    for (let card of productCards) {
      const titleEl = await card.$('.product-title');
      const priceEl = await card.$('.product-price');
      let title = titleEl ? (await titleEl.innerText()).trim() : '';
      let priceText = priceEl ? (await priceEl.innerText()).trim() : '';
      // Extract price as number
      let priceMatch = priceText.match(/\$([0-9,.]+)/);
      let price = priceMatch ? parseFloat(priceMatch[1].replace(/,/g, '')) : null;
      if (price !== null && price >= 100 && price <= 500) {
        filteredProducts.push({ title, price });
      }
    }

    return {
      success: true,
      action: "Applied price range filter (100 to 500) and verified filtered products.",
      extractedData: {
        filteredProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
